import React, { Component } from "react";
import { Nav, Button, Tab, Tabs, NavItem, TabContent } from "react-bootstrap";
import Content from "./Content";
import "../../styles/maincontent.css";

export class TabBar extends Component {
  constructor(props) {
    super(props);
  }

  randomRender() {
    return <Content greeting={"doughnut"} />;
  }
  render() {
    return (
      <Tabs justify="true" variant="pills">
        <TabContent as={Button} variant="danger">
          Home
        </TabContent>
        <Tab as={Button} variant="info">
          Analytics
        </Tab>
        <Tab
          as={"Button"}
          onClick={() => this.randomRender()}
          id="button1"
          variant="dark"
        >
          Settings
        </Tab>
        <Tab as={"Button"} id="button1">
          Messaging
        </Tab>

        {/* <Button variant="danger">Home</Button>

        <Button>Activites</Button>

        <Button eventKey="link-2">Link</Button>

        <Button variant="danger">Disabled</Button> */}
      </Tabs>
    );
  }
}
export default TabBar;
